import './App.css';

import Card from './Components/Card';
import data from "./Components/data";


const Propagonist = 'Arjun';

const Choose = ()=>{
  if( Propagonist==='Arjun'){
    return(
      <Card 
        title = {data[0].title}
        imglink = {data[0].imglink}
        info = {data[0].info}
      />
    )
  }
  else{
      return(
      <Card 
        title = {data[1].title}
        imglink = {data[1].imglink}
        info = {data[1].info}
      />
    )
  }
}

function App() {
  return(
    <div className="App">

      <div className="cardblock">

      // Components sarkh call karav lagel tevhach 
      <Choose/>

      </div>

    </div>
  );
}

export default App;
